from typing import List
from collections import Counter,defaultdict
class Solution:
    def findSubstring(self, s: str, words: List[str]) -> List[int]:
        stringLenth=len(s)
        singleWordsLength=len(words[0])
        totalWordsLength=len(words)*singleWordsLength
        answer=[]
        wordsDict=Counter("".join(words))
        wordsListDict=defaultdict(lambda: 0)
        for w in words:
            wordsListDict[w]+=1

        for i in range(stringLenth-totalWordsLength+1):
            sequence=s[i:i+totalWordsLength]
            if Counter(sequence)==wordsDict:
                count=0
                merge=True
                index=i
                wordsListDictCopy=wordsListDict.copy()
                while merge and count<len(words):
                    probableWord=s[index:index+singleWordsLength]
                    if probableWord in wordsListDictCopy:
                        wordsListDictCopy[probableWord]-=1
                        if wordsListDictCopy[probableWord]==0:
                            wordsListDictCopy.pop(probableWord)
                        index+=singleWordsLength
                        count+=1
                    else:
                        merge=False
                if merge:
                    answer.append(i)
        return answer
            


